script: |
  super -f text -I q1227.spq | sort > q1227.out

inputs:
  - name: q1227.spq
    data: |
      SELECT DISTINCT - col2 - + CAST ( NULL AS INTEGER ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 + col1 NOT BETWEEN NULL AND - - col2 * - + 33 * + col0 + - + CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q1227.out
    data: |
